import { useState } from "react";
import Paint from "./frontend/Paint.js";
import "./frontend/App.css";
import Lobby from "./frontend/Lobby.js";

function App() {
    const [joined, setJoined] = useState(false);

    return (
        <div className="App">
            {joined ? <Paint /> : <Lobby onJoin={() => setJoined(true)} />}
        </div>
    );
}

export default App;
